// src/EmployeeSearch.js
import React, { useState } from 'react';
import { CSVLink } from 'react-csv';

const EmployeeSearch = () => {
  const [employeeId, setEmployeeId] = useState('');
  const [name, setName] = useState('');
  const [department, setDepartment] = useState('');
  const [position, setPosition] = useState('');
  const [filteredData, setFilteredData] = useState([]);

  const employees = [
    { employeeId: '001', name: 'Alice', department: 'IT', position: 'Manager' },
    { employeeId: '002', name: 'Bob', department: 'HR', position: 'Staff' },
    { employeeId: '003', name: 'Charlie', department: 'Finance', position: 'Intern' },
  ];

  const handleSearch = () => {
    const results = employees.filter(emp =>
      (employeeId === '' || emp.employeeId.includes(employeeId)) &&
      (name === '' || emp.name.includes(name)) &&
      (department === '' || emp.department.includes(department)) &&
      (position === '' || emp.position.includes(position))
    );
    setFilteredData(results);
  };

  const headers = [
    { label: "Employee ID", key: "employeeId" },
    { label: "Name", key: "name" },
    { label: "Department", key: "department" },
    { label: "Position", key: "position" }
  ];

  return (
    <div>
      <h1>Employee Search</h1>

      <div>
        <label>
          Employee ID:
          <input
            type="text"
            value={employeeId}
            onChange={(e) => setEmployeeId(e.target.value)}
          />
        </label>
      </div>

      <div>
        <label>
          Name:
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
        </label>
      </div>

      <div>
        <label>
          Department:
          <input
            type="text"
            value={department}
            onChange={(e) => setDepartment(e.target.value)}
            placeholder="Enter or select department"
          />
        </label>
      </div>

      <div>
        <label>
          Position:
          <input
            type="text"
            value={position}
            onChange={(e) => setPosition(e.target.value)}
            placeholder="Enter or select position"
          />
        </label>
      </div>

      <button onClick={handleSearch}>Search</button>

      <h2>Search Results</h2>
      <table>
        <thead>
          <tr>
            <th>Employee ID</th>
            <th>Name</th>
            <th>Department</th>
            <th>Position</th>
          </tr>
        </thead>
        <tbody>
          {filteredData.length > 0 ? (
            filteredData.map((emp) => (
              <tr key={emp.employeeId}>
                <td>{emp.employeeId}</td>
                <td>{emp.name}</td>
                <td>{emp.department}</td>
                <td>{emp.position}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="4">No results found</td>
            </tr>
          )}
        </tbody>
      </table>

      {filteredData.length > 0 && (
        <CSVLink
          data={filteredData}
          headers={headers}
          filename={"employee_data.csv"}
        >
          Download CSV
        </CSVLink>
      )}
    </div>
  );
};

export default EmployeeSearch;
